import React from "react";
import { Link, NavLink } from "react-router-dom";
const Menu = () => {
  return (
    <>
      <NavLink activeClassName="active_class" to="/">
        {" "}
        AboutUs{" "}
      </NavLink>
      <NavLink to="/contact"> ContactUs </NavLink>
      <br />
      <a href="/"> AboutUs</a>
      <a href="/contact"> ContactUs </a>
    </>
  );
};

export default Menu;
